INSERT INTO `actor` (`actorId`, `actor_name`, `gender`, `dob`, `about`, `image`) VALUES
(4, 'Tom Hanks', 'Férfi', '1956-07-09', 'Tom Hanks (születési neve: Thomas Jeffrey Hanks) (Concord, Kalifornia, 1956. július 9. –) kétszeres Oscar-díjas és négyszeres Golden Globe-díjas amerikai színész, producer, író, filmrendező, aki pályafutása során sok népszerű és elismert filmben szerepelt már. ', );
INSERT INTO `actor` (`actorId`, `actor_name`, `gender`, `dob`, `about`, `image`) VALUES
(5, 'Leonardo DiCaprio', 'Férfi', '1974-11-11', 'Leonardo Wilhelm DiCaprio (Los Angeles, Kalifornia, 1974. november 11. – ) Oscar-díjas és többszörös Golden Globe-díjas amerikai színész. Világhírnevet a Titanic című film főszerepével nyert, ezenkívül olyan további sikeres produkciókban játszott, mint a Rómeó + Júlia, a Kapj el, ha tudsz, az Aviátor, A tégla, az Eredet, a Viharsziget, a Véres gyémánt, A nagy Gatsby, A Wall Street farkasa vagy A visszatérő. Az utóbbi időkben Martin Scorsesével dolgozott együtt több filmen is, hasonlóan ahhoz, ahogy karrierje kezdetén Robert De Niro is gyakran forgatott a rendezővel. DiCaprio neves környezetvédelmi aktivista is, az egyik legkiemelkedőbb élharcosa a klímaváltozás ellen szorgalmazott lépéseknek. 2014-től az ENSZ békekövete. A 2016-ban bemutatott alkotása az Özönvíz előtt, amely az utóbbi időben az egyik legnézettebb dokumentumfilm lett.', );
INSERT INTO `actor` (`actorId`, `actor_name`, `gender`, `dob`, `about`, `image`) VALUES
(6, 'Harrison Ford', 'Férfi', '1942-07-13', 'Harrison Ford (Chicago, Illinois, 1942. július 13. –) Oscar-díjra jelölt amerikai színész. Legismertebb szerepei a vagány, cinikus űrpilóta, Han Solo az eredeti Csillagok háborúja trilógiában, és a kalandvágyó régészprofesszor, Dr. Henry „Indiana” Jones Jr. az Indiana Jones-filmsorozatban. Négy évtizedet átölelő karrierje során olyan népszerű filmekben játszott még, mint a Szárnyas fejvadász, A szökevény vagy Az elnök különgépe. Egy ponton minden idők öt legnagyobb bevételt elérő filmjében is szerepe volt (noha az E. T., a földönkívüliből jeleneteit kivágták végül); a Nemzeti Filmarchívumba öt filmjét választotta be a Egyesült Államok Nemzeti Filmmegőrzési Bizottsága.\n\nAz Empire magazin Fordot első helyre sorolta a minden idők 100 legnagyobb filmsztárját számba vevő listáján. 2010-zel bezárólag filmjei 3,4 milliárd dollárt hoztak az amerikai jegypénztáraknál, míg világviszonylatban ez az összeg megközelíti a 6 milliárdot. Ezzel Ford a 3. legnagyobb box office-sztár Észak-Amerikában Tom Hanks és Eddie Murphy mögött.', ),
(7, 'Robert John Downey, Jr.', 'Férfi', '1965-04-05', 'Robert John Downey, Jr. (Manhattan, New York, 1965. április 4. –) háromszoros Golden Globe-díjas amerikai színész és énekes. Legismertebb szerepe Tony Stark/Vasember a Marvel-moziuniverzum filmjeiben. Robert John Downey Jr. a New York-i Greenwich Village-ben született az underground filmes Robert Downey Sr. és Elsie Downey fiaként', );
INSERT INTO `actor` (`actorId`, `actor_name`, `gender`, `dob`, `about`, `image`) VALUES
(8, 'Matthew McConaughey', 'Férfi', '1969-11-04', 'Matthew McConaughey (Uvalde, Texas, 1969. november 4. –) Oscar-díjas és Golden Globe-díjas amerikai színész. 2014-ben Oscar-díjra jelölték a Mielőtt meghaltam című filmben nyújtott alakításáért, amit meg is nyert', );
INSERT INTO `actor` (`actorId`, `actor_name`, `gender`, `dob`, `about`, `image`) VALUES
(9, 'Christian Bale', 'Férfi', '1974-01-30', 'Christian Bale (Haverfordwest, 1974. január 30. –) Oscar- és Golden Globe-díjas brit színész.  Christian még fiatal korában háta mögött hagyta anyját és Angliából apjához költözött az Egyesült Államokba. Anyja és nővérei cirkuszosok, apja környezetvédő aktivistaként dolgozik.', );

