--
-- A tábla adatainak kiíratása `movie`
--

INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(2, 'Nagymenők', 'Krimi', 1, 'Henry Hill gyerekkora óta nagymenõ szeretett volna lenni. Vágyakozva bámulta a szemközt lakó maffiózót, aki mindig nagy kocsikon érkezett haza, akit mindig a legjobb nõk kísértek, és akit soha nem zaklatott a rendõrség, ha túl hangos bulit csapott az éjszaka közepén. Henry egy napon nagy elhatározásra jut: önként jelentkezik a maffiózónál kisegítõnek. Néhány nap múlva már õ árulja a lopott cigarettát a gyárkapuban, néhány hónap múlva már név szerint ismeri õt a legjobb bár ajtónállója és nem telik el sok idõ, mire az utcán elõre köszönnek neki a tõle rettegõ emberek? ', 1991, '8.7', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(3, 'A Wall Street farkasa', 'Vígjáték', 1, 'A pénz sosem elég.\r\nJordan Belfort (Leonardo DiCaprio) becsületes tőzsdeügynökként kezdte pályafutását, de az amerikai álom őt is utolérte. A 80-as évek végére az egyik legnagyobb brókercég tulajdonosa lett, 26 évesen heti 1 millió dollárt keresett. Az idáig vezető út azonban korrupcióval és tisztességtelen üzletekkel kikövezett csábító hullámvasútnak bizonyult.\r\nMert minél nagyobb volt a kísértés ő annál többet akart, mit sem törődve az illegális üzelmekkel és a nyomában loholó FBI ügynökökkel. Még több pénz, még több hatalom, még több nő és megint még több pénz: ez Jordan életfilozófiája.', 2013, '8.2', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(5, 'Viharsziget', 'Thriller', 1, 'A világtól elzárva, a Massachusetts állam partjainál fekvő kis szigeten lévő elmegyógyintézetben tartják fogva az Egyesült Államok legveszedelmesebb elmebeteg bűnözőit. Amikor az ötvenes években a szigorúan őrzött intézményből megmagyarázhatatlan módon megszökik egy gyilkosságért elítélt nő, az igazgató, Dr. Cawley kénytelen külső segítséget kérni. Két rendőrbíró, Teddy Daniels és Chuck Aule utazik a szigetre, hogy kiderítse, mi történt, és megtalálja a szökevényt. Danielsnek nemcsak a munkáját hátráltató pszichiáterrel, hanem a saját démonaival is meg kell küzdenie. ', 2010, '8.1', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(6, 'Ponyvaregény', 'Vígjáték', 3, 'Adott két idősödő, szabad szájú, tökös szimpatikus gengszter, Vincent (John Travolta) és Jules (Samuel L. Jackson), akik igyekeznek főnöküknek visszaszerezni egy aktatáskát.\r\nEhhez persze meg kell ölniük pár embert de ez az egyszerű bérgyilkosokkal gyakran megesik.\r\nJules a rá célzott golyókat csodával határos módon elkerüli, s ezt jelnek tekintvén úgy dönt, felhagy eddigi életével.\r\nTársának viszont el kell vinnie szórakozni a gengszterfőnök feleségét...\r\nVan továbbá egy boxoló, Butch (Bruce Willis), aki a hírhedt marffiafőnök, Marselleus Wallace (Ving Rhames) átvágását tervezi.\r\nHogy-hogy nem, odáig fajul a történet, hogy végül már inkább a megmentésére készül, mint a lelövésére...\r\nNem utolsósorban, pedig, van egy piti rabló-párosunk is (Tim Roth és Amanda Plummer), akik éppen egy étterem kirablására készülnek.\r\nÁm ott reggelizik Vincent és Jules... ', 1995, '8.9', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(7, 'Kutyaszorítóban', 'Krimi', 3, ' Egy gyakorlott tolvajbanda fegyveres rablást követ el egy gyémántraktárban. A rendőrség meglepően hamar a helyszínre ér, ezért felmerül a gyanú, hogy valaki a banda tagjai közül besúgó. A cselekmény a rablás elkövetése után indul, és egy-egy visszatekintő jelenetben idéződik fel az azt megelőző időszak, a bűntett kitervelésének fázisa, illetve ily módon ismerjük meg magukat a szereplőket is. ', 1992, '8.3', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(8, 'Becstelen brigantyk', 'Háborús', 3, 'A megszállt Franciaországban Shosanna szemtanúja lesz, ahogy a német Hans Landa ezredes lemészároltatja a családját. A lánynak sikerül megszöknie. Új személyiséget felvéve Párizsban telepszik le, ahol egy mozit üzemeltet.\r\nKözben az amerikai Aldo Raine hadnagy zsidó katonákból verbuvál csapatot, amely a brutális akciói miatt kétes hírnévre tesz szert a németek között. A német vezetés Shosanna moziját szemeli ki az új propagandafilm premierjére, melyen a Führer és a többi vezető is megjelenik.\r\nMiközben Shosanna merényletre készül, Raine csapata is akcióba lendül, hogy a helyzetet kihasználja. ', 2009, '8.3', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(10, 'Memento', 'Thriller', 4, 'Leonard Shelby (Guy Pearce) életét egyetlen cél vezérli: megtalálni azt, aki megölte és megerőszakolta feleségét és bosszút állni haláláért. Leonard azonban egy furcsa, gyógyíthatatlan betegségben szenved.\r\nAmnéziás és a frissen szerzett élményekre is képtelen emlékezni.\r\nEgyetlen dologban biztos csupán: bosszút akar állni. Betegsége azonban különösen megnehezíti ezt. Polaroid képekkel dokumentálja minden lépését, névjegykártyák, dokumentumok, tetoválások segítségével próbálja összerakosgatni élete és a brutális gyilkosság darabkáit.\r\nA szálak egyre bonyolódnak, mindenki gyanússá válik, talán még maga Leonard is.\r\nA nagy kérdés pedig még mindig nyitva áll: ki a gyilkos? ', 2000, '8.5', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(26, 'E. T. a földönkívüli', 'Sc-Fi', 7, 'Egy amerikai kisváros szélén, a családi házaktól alig néhány méternyire húzódó erdőben földet ér egy űrhajó, melyből fura kinézetű \"emberkék\" szállnak ki, hogy felderítsék a terepet. Ám hamarosan a helyszínre érkeznek a földlakók: őrült zajt csapva, villódzó zseblámpájukkal megrémisztik a békés szándékú látogatókat, s miközben megpróbálják bekeríteni űrjárművüket, a furcsa kis lények menekülésbe fognak. Egy \"valaki\" közülük azonban lemarad a távozó űrjárműről. Ez a valaki pedig nem más, mint E.T., aki a számára ismeretlen bolygón marad dühös kutyák, nyüzsgő járművek és egy furcsa kisfiú társaságában.', 1982, '7.8', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(27, 'Ryan közlegény megmentése', 'Háborús', 7, '1944. június 6 - a normandiai partraszállás napja. Az Omaha Beach kódnevet kapott tengerparton a csónakokból védhető fedezékbe igyekvő szövetséges katonák pergőtűzbe kerülnek, a vérveszteség óriási. Mindenütt halottak, sebesültek, cafatokra szakadt emberi testrészek, haldoklók halálhörgései.\r\nA pokol első bugyrán éppen csak túljutott Miller százados (Tom Hanks) megmaradt embereivel újabb szinte lehetetlen próbatétel előtt áll. Egy kis csapat élén be kell hatolnia az ellenséges hátországba, hogy felkutasson egy amerikai katonát, James Ryan közlegényt.\r\n', 1998, '8.6', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(28, 'Kapj el, ha tudsz', 'Krimi', 7, 'Igaz történet alapján.\n\nFrank W. Abagnale dolgozott orvosként, ügyvédként és egy nagy légitársaság másodpilótájaként - és mindezt a huszonegyedik születésnapja előtt.\nA szélhámosság nagymestere emellett briliáns csekkhamisító is volt, szakértelme több millió dollárt hozott neki a konyhára.\nCarl Hanratty FBI ügynök legfontosabb küldetésének tartotta, hogy elkapja Franket, és a törvény színe elé vigye de Frank mindig egy lépéssel előtte járt, és a hajsza folytatására kényszerítette. ', 2002, '8.1', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(29, 'Eredet', 'Sc-Fi', 4, 'Dom Cobb álomtolvaj: értékes információkat lop ki az áldozatok agyából, amikor azok alszanak és védtelen az elméjük.\nBár nagyszerűen keres, nincs magánélete, a veszélyes tudása miatt állandóan menekülnie kell.\nVáratlanul kap egy esélyt, visszakaphatja a régi életét, a családját, a gyerekeit. Ezúttal azonban nem lopnia kell, hanem egy gondolatot kell elültetnie valakinek az agyában.\nHa sikerül a feladat, ez lehet a tökéletes bűntény. Ám hiába az alapos tervezés és a felkészült csapat, a veszélyes ellenfél minden lépésüket előre látja.\nEgy ellenfél, aki mintha olvasna Cobb gondolataiban. ', 2010, '8.8', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(30, 'Indiana Jones és a végzet temploma', 'Kaland', 7, 'Balul üt ki Indiana Jones tárgyalása a rettegett kínai bűnszervezet vezetőjével. Hősünk, oldalán Willie-vel, a bárénekesnővel és Picúrral, a kínai kisfiúval menekülni kényszerül Sanghajból. Indiában kötnek ki, ahol az egyik kis falu lakosai Jones segítségét kérik. Nem elég, hogy az oltárukról elrabolták a kincset érő varázserejű követ, de a maharadzsa emberei a gyermekeiket is magukkal hurcolták. Kiderül, hogy a tizenkét éves maharadzsa a gyilkos szekta befolyása alatt áll, melynek tagjai a Végzet Temploma alatti labirintusban dolgoztatják az elrabolt gyerekeket. Jones felveszi a harcot ellenük. ', 1984, '7.6', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(36, 'Blöff', 'Akció', 8, 'A gyémántokra specializálódott, minden hájjal megkent ékszertolvaj, Franky Four Fingers, miután teljesítette legfrissebb megbízatását New Yorkba indul, hogy szállítsa az árut főnökének, Avinek.\nÚtközben azonban megáll Londonban, ahol apróbb brilleket kell kézbesítenie megbízója ügyfeleinek. Boris, egy szélhámos orosz ráveszi Frankyt, hogy fogadjon egy illegális bokszmeccsen, ahol tervei szerint kirabolja majd a férfit. ', 2000, '8.3', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(37, 'Úriemberek', 'Krimi', 8, 'Amikor híre megy, hogy az amerikai drogkereskedő, Mickey Pearson (Matthew McConaughey) túl akar adni szuperjövedelmező londoni marihuána birodalmán az egész alvilág felbolydul. Rengeteg lóvé forog kockán, nem is csoda, hogy a gengszterek között kirobban a harc. Bérgyilkosok, kisstílű bűnözők, nagypályások, dílerek, mindenféle kétes alakok bukkannak fel a meggazdagodás reményében. A helyzet kezd igen csak eldurvulni: egyre több hulla potyog, egyre több fegyver kerül terítékre, ám azt mégis nehéz lenne megjósolni, hogy végül kinek a kezében landol a csinos drogbiznisz. ', 2019, '8.1', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(38, 'Sherlock Holmes', 'Kaland', 8, 'Hogy hívták 1891-ben James Bondot? Természetesen Sherlock Holmesnak (Robert Downey Jr.). A legendás mesterdetektív, aki közelharcban legalább olyan verhetetlen, mint logikus gondolkodásban, élete legnagyobb problémájával kerül szembe. Ő és hű társa, doktor Watson (Jude Law) Lord Blackwood nyomába vetik magukat. Ha nem leplezik le időben, az az egész Brit birodalmat megrázhatja. ', 2009, '7.6', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(39, 'Sherlock Holmes 2. - Árnyjáték', 'Kaland', 8, 'A világ leghíresebb és legokosabb magándetektívje (Robert Downey Jr.) visszatér - és vár rá néhány nagy meglepetés. Végre emberére akad, nyomába eredhet annak a zseniális bűnözőnek, aki mindarra képes, amire ő csak a rossz szolgálatában. Moriarty professzor (Jared Harris) lelkiismeret-furdalás nélkül követi el a legvadabb bűntényeket. Ha érdekei úgy kívánják, még az osztrák koronaherceget is képes meggyilkolni.\nMiközben Watson (Jude Law) az esküvőjére készül, társa nyakig merül az ügybe, és nemcsak a doktort, hanem saját, szintén zseniális bátyját (Stephen Fry) és egy gyönyörű, de veszélyes jósnőt (Noomi Rapace) is magával ránt. Egész Európán keresztül folyik az üldözés, és a professzor egy lépéssel mindig előttük jár. ', 2011, '7.5', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(40, 'Csillagok között', 'Sc-Fi', 1, 'Az emberiség tönkretette a Földet.\nA bolygó egyre pusztul, a készletek kiapadóban, az emberek pedig felkészülhetnek a legrosszabbra: a gyerekeik valószínűleg az utolsó generáció itt.\nDe nem mindenki hajlandó belenyugodni a pusztulásba.\nEgy csapat felfedező (Matthew McConaughey, Anne Hathaway, Wes Bentley) elindul a történelem legfontosabb, legveszélyesebb útjára.\nŰrhajójukkal túl akarnak jutni a Galaxis határán, hogy megtudják: lehet-e jövője az embernek valahol egészen másutt… a csillagok között. ', 2014, '8.6', );
INSERT INTO `movie` (`movieId`, `title`, `genre`, `directorId`, `about`, `year`, `rating`, `img`) VALUES
(41, 'A sötét lovag', 'Akció', 4, 'Batman (Christian Bale) valamint két társa, egy rendõr (Gary Oldman) és egy ügyész (Aaron Eckhart) mindent elkövet, hogy megtisztítsa Gotham City utcáit a banditáktól. Már kezdik azt hinni, önként vállalt feladatukat siker koronázhatja, amikor megjelenik a bûnözõk között valaki, aki minden elõdjénél ravaszabb és veszélyesebb.\nÚgy hívják: Joker (Heath Ledger). A városban ettõl kezdve a félelem az úr: elszabadul a korlátlan, értelmetlen, kivédhetetlennek tûnõ gonoszság. ', 2008, '9', );

