INSERT INTO `rendezo` (`directorId`, `name`, `gender`, `dob`, `about`, `image`) VALUES
(1, 'Martin Scorsese', 'Férfi', '1942-11-17', 'Martin Scorsese (New York, 1942. november 17. –) Oscar-díjas olasz-amerikai[2] filmrendező, a modern filmművészet egyik legelismertebb alkotója.[3] Több mint 50 éves karrierje során alkotásai gyakran visszatérnek az olasz-amerikai társadalmi identitáshoz és a római katolicizmus erkölcsi kérdéseihez,[4] mint a bűn, bűnhődés, bosszú, hit, macsóság, szervezett bűnözés, társadalmi egyenlőtlenségek. Művészetét már számos kitüntetéssel és elismeréssel jutalmazták.[5] ', );
INSERT INTO `rendezo` (`directorId`, `name`, `gender`, `dob`, `about`, `image`) VALUES
(3, 'Quentin Tarantino', 'Férfi', '1963-03-27', 'Quentin Tarantino (Knoxville, Tennessee, 1963. március 27. –) kétszeres Oscar-díjas olasz származású amerikai rendező, színész, forgatókönyvíró, producer, az amerikai független film egyik legnagyobb hatású alakja. ', ''),
(4, 'Christopher Nolan', 'Férfi', '1970-07-30', 'Christopher Nolan (London, 1970. július 30. –) angol filmrendező, producer, forgatókönyvíró. Első nagyjátékfilmje, a Following (1998), amelyet ő írt, rendezett és vágott, több nemzetközi filmfesztiválon is részt vett és díjakat kapott. Ez a sikersorozat hívta fel a figyelmet rá és segített megteremteni a Mementó (2000) anyagi hátterét, melyet Nolan írt és rendezett, mind a kritikusok, mind a nézők körében nagy sikert aratott. Számos díjat és jelölést is szerzett: például a Sundance Filmfesztivál forgatókönyvírói díját, a forgatókönyvért Golden Globe- és Oscar-jelölést. A film nagy sikert aratott több nemzetközi fesztiválon. ', '');
INSERT INTO `rendezo` (`directorId`, `name`, `gender`, `dob`, `about`, `image`) VALUES
(6, 'Valaki Jani', 'Férfi', '2020-04-02', 'dasdasdasdasdasd', );
INSERT INTO `rendezo` (`directorId`, `name`, `gender`, `dob`, `about`, `image`) VALUES
(7, 'Steven Spielberg', 'Férfi', '1946-12-18', 'Steven Spielberg (Cincinnati, Ohio, 1946. december 18. –) háromszoros Oscar-díjas amerikai filmrendező, producer, a Brit Birodalom lovagja, a legsikeresebb filmrendezők egyike.\n\nAz elmúlt években erős érzelmi töltetű témákat érintett filmjeiben, mint a holokauszt borzalmai a Schindler listájában, a rabszolgaság az Amistadban, a háborús viszontagságok a Ryan közlegény megmentésében és a terrorizmus a Münchenben. Nem korhatáros filmjeinek egyik gyakran visszatérő témája az a gyermeki, néha talán naiv hit és rácsodálkozás, ami megjelenik például a Harmadik típusú találkozások, az E. T., a Hook és az A. I. – Mesterséges értelem című filmjeiben. ', );
INSERT INTO `rendezo` (`directorId`, `name`, `gender`, `dob`, `about`, `image`) VALUES
(8, 'Guy Ritchie', 'Férfi', '1968-09-10', 'Guy Stuart Ritchie (Hatfield, 1968. szeptember 10. –) angol forgatókönyvíró és filmkészítő, leginkább A Ravasz, az Agy és két füstölgő puskacső, a Blöff, a Spíler, a Sherlock Holmes és folytatásának rendezőjeként ismert.', );

